import React from 'react';
import { BrowserRouter, Route, Link } from 'react-router-dom';




const App = () => {
    return (
        <div>
            <BrowserRouter>
                <div>
                    <Route path="/" exact={true} component={PageOne} />
                    <Route path="/pageTwo" component={PageTwo} /> 
                </div>
            </BrowserRouter>
        </div>
    )
};

export default App;
